DROP TABLE IF EXISTS `wiz_mall`;
CREATE TABLE `wiz_mall` (
  `id` varchar(20) NOT NULL default '',
  `passwd` varchar(32) default NULL,
  `com_name` varchar(50) default NULL,
  `com_owner` varchar(20) default NULL,
  `com_num` varchar(20) default NULL,
  `com_kind` varchar(50) default NULL,
  `com_class` varchar(50) default NULL,
  `com_tel` varchar(20) default NULL,
  `com_hp` varchar(20) default NULL,
  `com_fax` varchar(20) default NULL,
  `acc_name` varchar(20) default NULL,
  `acc_bank` varchar(20) default NULL,
  `acc_num` varchar(20) default NULL,
  `manager` varchar(20) default NULL,
  `email` varchar(50) default NULL,
  `homepage` varchar(50) default NULL,
  `post` varchar(7) default NULL,
  `address` varchar(255) default NULL,
  `address2` varchar(255) default NULL,
  `photo` varchar(30) default NULL,
  `intro` mediumtext,
  `comment` mediumtext,
  `cms_type` char(1) default NULL,
  `cms_rate` int(11) default NULL,
  `del_com` varchar(20) default NULL,
  `del_trace` mediumtext,
  `del_prd` enum('DA','DB') default NULL,
  `del_prd2` enum('DA','DB') default NULL,
  `del_method` enum('DA','DB','DC','DD') default NULL,
  `del_fixprice` int(11) default NULL,
  `del_staprice` int(11) default NULL,
  `del_staprice2` int(11) default NULL,
  `del_staprice3` int(11) default NULL,
  `del_extrapost1` int(11) default NULL,
  `del_extrapost12` int(11) default NULL,
  `del_extraprice1` int(11) default NULL,
  `del_extrapost2` int(11) default NULL,
  `del_extrapost22` int(11) default NULL,
  `del_extraprice2` int(11) default NULL,
  `del_extrapost3` int(11) default NULL,
  `del_extrapost32` int(11) default NULL,
  `del_extraprice3` int(11) default NULL,
  `guide` mediumtext,
  `status` enum('Y','N') default NULL,
  `wdate` datetime default NULL,
  `adate` datetime default NULL,
  `last` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=euckr;

